@notice Initializes the prices for tokens in a given pool
@dev This function is restricted to be called only by the liquidity ramp.
@param poolIdx The index of the liquidity pool whose prices are to be initialized

@notice Updates the allocation for maintenance tasks
@dev Can only be called by the owner of the contract. Restricts the maintenance allocation to 50% max.
@param _maintenanceAllocation The new allocation for maintenance

@notice Updates the allocation for routing tasks
@dev Can only be called by the owner of the contract. Allows up to 100% allocation for routing.
@param _routingAllocation The new allocation for routing

@notice Executes a token swap in a specified liquidity pool.
@dev Swaps `amountIn` of `tokenIn` for an output amount of a different token.
@param poolIdx The index of the liquidity pool used for the swap.
@param recipient The address to receive the swapped tokens.
@param routingAgent The agent responsible for routing transactions.
@param tokenIn The token to be swapped.
@param amountIn The amount of `tokenIn` to swap.
@return amountOut The amount of output token received.

@notice Mints liquidity provider tokens from swap profits.
@dev Calculates the number of LP tokens to mint based on the liquidity change after a swap.
     These tokens are then allocated to the routing agent and treasury based on set proportions.
@param startLiquidity The liquidity of the pool before the swap.
@param balanceTokenIn The new balance of the input token in the liquidity pool after the swap.
@param balanceTokenOut The new balance of the output token in the liquidity pool after the swap.
@param lpToken Reference to the LP token contract for the pool.
@param routingAgent The address of the routing agent.

@title SwapManager
@dev This contract allows users to execute token swaps.
It also performs various management functions.
It inherits from Ownable and ReentrancyGuard contracts for security.
